import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {

const time = new Date();
const a = 15;
const b = 25;

return(
  <div>
    <p>Hello world, the time now is {time}</p>
    <p> {a} + {b} is equal to {a+b} </p>
  </div>
)
};

ReactDOM.render(<App />, document.getElementById('root'))
